import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import reportWebVitals from './reportWebVitals';
import { Route, BrowserRouter, Routes } from 'react-router-dom';
import HomePage from './pages/home.page';
import BookForm from './pages/BookForm.page';
import BookList from './pages/BookList.page'; // Certifique-se de que o caminho est치 correto
import { IBook } from './interfaces/book.interface'; // Certifique-se de que o caminho est치 correto

const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);

root.render(
  <React.StrictMode>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route
          path="/books/create"
          element={<BookForm onAddBook={(book: IBook): void => { console.log(book); }} />}
        />
        <Route path="/books/list" element={<BookList />} />
      </Routes>
    </BrowserRouter>
  </React.StrictMode>
);

reportWebVitals();
